idence": 0.85, "description": "The Licensor grants the Licensee access to proprietary propagation methods covered by US Patents 11,456,892 and 11,234,567, as well as trade secret 'GreenGrowâ„¢ Nutrient Formula and Application Methods'."}, {"type": "Termination & Post-Termination", "location": "Section 9.1", "confidence": 0.8, "description": "Either party may terminate the agreement upon 180 days written notice for material breach, or upon 12 months notice for convenience. Upon termination, the Licensee may sell existing finished inventory for 18 months subject to continued royalty payments."}, {"type": "Financial Obligations", "location": "Section 4.1 and 6.3", "confidence": 0.85, "description": "The Licensee must pay an initial license fee of $125,000, as well as annual certification and inspection fees of $12,500. The Licensee also guarantees minimum annual royalty payments totaling $85,000."}, {"type": "Performance Requirements", "location": "Section 5.1", "confidence": 0.8, "description": "The Licensee must commit to minimum annual production levels, with 15,000 total plants across all varieties in Years 1-2, increasing to 35,000 total plants with 20% year-over-year growth in Years 3-4."}, {"type": "Territory & Scope", "location": "Section 2.1", "confidence": 0.85, "description": "The agreement grants exclusive production and distribution rights within the Primary Territory (Oregon, Washington, Northern California, and Idaho), with non-exclusive rights in the Secondary Territory (Montana, Wyoming, Utah, and Nevada)."}]}	2025-12-03 18:05:01.576257
